    private static void testIndexedGet(final BiFunction<Collection<Student>, int[], List<String>> query, final String... answers) {
        for (int i = 0; i < STUDENTS.size(); i++) {
            final Collection<Student> students = STUDENTS.subList(0, i);
            final int max = i;
            final int[] indices = IntStream.of(INDICES).filter(v -> v < max).toArray();
            final String actual = String.join(",", query.apply(students, indices));
            Assert.assertEquals(answers[i], actual);
        }
    }
